import React, {  } from 'react';
import styles from './ButtonPage.module.css';


export default function ButtonPage({ pageList, setPageIndex, page_index, page }) {
    return (
        <button
            id={page_index === page ? styles.isOn : ''}
            className={styles.nav_button}
            onClick={() => setPageIndex(page)}
        >
            {pageList[page]}
        </button>
    );
}
